import React from 'react';
import Header from './src/components/Header';
import Projects from './src/components/Projects';
import Contact from './src/components/Contact';
import Footer from './src/components/Footer';
import './styles.css';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <section id="about">
          <h2>Обо мне</h2>
          <p>Привет! Меня зовут Максим, мне 17 лет. Я начинающий программист из Подмосковья. Работаю на складе OZON и изучаю программирование в колледже.</p>
        </section>
        <Projects />
        <Contact />
      </main>
      <Footer />
    </div>
  );
}

export default App;
